class Handler {
    constructor() {
        this._crc = new Crc();
        this._handles = {};
        this._crc.makeTable();
    }
    crc(name) {
        return this._crc.crc32(name);
    }
    register(cls, name, func, obj) {
        let cf = new CmdFun();
        cf.cls = cls;
        cf.obj = obj;
        cf.func = func;
        let no = this.crc(name);
        this._handles[no] = cf;
    }
    redirect(name, func) {
        let no = this.crc(name);
        let h = this._handles[no];
        h.callback = func;
    }
    onCmd(no, data) {
        let h = this._handles[no];
        if (h == null) {
            console.error("unhandled cmd: ", no);
            return false;
        }
        let v = h.cls.decode(data.bytes);
        console.log("Handler::onCmd: ", v);
        if (h.func != null) {
            h.func.call(h.obj, v);
        }
        if (h.callback != null) {
            h.callback(v);
        }
        return true;
    }
}
